const actions = {
  GET_LIST_SUB_ADMIN_BEGIN: 'GET_LIST_SUB_ADMIN_BEGIN',
  ADD_NEW_SUB_ADMIN: 'ADD_NEW_SUB_ADMIN',
  GET_LIST_SUB_ADMIN: 'GET_LIST_SUB_ADMIN',
  DELETE_ADMIN: 'DELETE_ADMIN',
  ERROR_GET_SUB_ADMIN: 'ERROR_GET_SUB_ADMIN',
  getListSubAdminBegin: () => ({
    type: actions.GET_LIST_SUB_ADMIN_BEGIN,
  }),
  addNewSubAdmin: errorMessageAdd => {
    return {
      type: actions.ADD_NEW_SUB_ADMIN,
      errorMessageAdd,
    };
  },
  erorrGetSubAdmin: errorMessageGetAdmin => {
    return {
      type: actions.ERROR_GET_SUB_ADMIN,
      errorMessageGetAdmin,
    };
  },
  getSubAdmin: data => {
    return {
      type: actions.GET_LIST_SUB_ADMIN,
      data,
    };
  },
  deleteAdmin: AdminId => {
    return {
      type: actions.DELETE_ADMIN,
      AdminId,
    };
  },
};

export default actions;
